    def mergeVerbAttributes(self, attributes):
        mergedAttributes = set()
        for a in attributes:
            if a[0] == 'v' and a != 'vs':
                mergedAttributes.add('v')
            else:
                mergedAttributes.add(a)
        return mergedAttributes

